def is_prime(element):
'''Returns whether a number is prime.'''
    if element < 2:
        return False
    elif element == 2:
        return True
    elif element % 2 == 0:
        return False
    else:
        for i in range(3, int(math.sqrt(element)) + 1, 2):
            if element % i == 0:
                return False
        return True
